#
# TABLE STRUCTURE FOR: ___add_new_article_sess
#

DROP TABLE IF EXISTS `___add_new_article_sess`;

CREATE TABLE `___add_new_article_sess` (
  `user_id` int(11) unsigned NOT NULL,
  `code` mediumtext,
  `name` varchar(100) DEFAULT NULL,
  `date_added` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: ___add_new_course_sess
#

DROP TABLE IF EXISTS `___add_new_course_sess`;

CREATE TABLE `___add_new_course_sess` (
  `user_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(200) DEFAULT NULL,
  `sub_title` varchar(200) DEFAULT NULL,
  `description` text,
  `course_img` varchar(100) DEFAULT NULL,
  `sections` mediumtext,
  `sub_category` varchar(50) DEFAULT NULL,
  `main_category` varchar(50) DEFAULT NULL,
  `active` tinyint(1) unsigned DEFAULT NULL,
  `date_added` int(10) unsigned DEFAULT NULL,
  `url_title` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: ___articles
#

DROP TABLE IF EXISTS `___articles`;

CREATE TABLE `___articles` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `code` mediumtext,
  `name_url_title` varchar(100) DEFAULT NULL,
  `name` varchar(100) DEFAULT NULL,
  `user_id` int(11) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: ___course_qa
#

DROP TABLE IF EXISTS `___course_qa`;

CREATE TABLE `___course_qa` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `course_code` varchar(32) DEFAULT NULL,
  `lid` varchar(10) DEFAULT NULL,
  `type` tinyint(1) unsigned DEFAULT NULL,
  `to` int(11) DEFAULT NULL,
  `text` text,
  `user_id` int(11) unsigned DEFAULT NULL,
  `time` int(10) unsigned DEFAULT NULL,
  `like` smallint(5) unsigned DEFAULT '0',
  `answer_count` smallint(5) unsigned DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=79 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: ___courses
#

DROP TABLE IF EXISTS `___courses`;

CREATE TABLE `___courses` (
  `course_id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned DEFAULT NULL,
  `course_img` varchar(100) DEFAULT NULL,
  `title` varchar(150) DEFAULT '',
  `sub_title` varchar(250) DEFAULT NULL,
  `description` text,
  `date_added` int(10) unsigned DEFAULT NULL,
  `sub_category` varchar(50) DEFAULT NULL,
  `main_category` varchar(50) DEFAULT NULL,
  `active` tinyint(1) unsigned DEFAULT NULL,
  `url_title` varchar(150) DEFAULT NULL,
  `sections` mediumtext,
  `score` float(3,2) DEFAULT '0.00',
  `course_code` varchar(32) DEFAULT NULL,
  `course_duration_seconds` int(5) unsigned DEFAULT NULL,
  `course_duration` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`course_id`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: ___groups
#

DROP TABLE IF EXISTS `___groups`;

CREATE TABLE `___groups` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  `description` varchar(250) NOT NULL,
  `group_level` smallint(8) NOT NULL,
  `date_added` int(10) DEFAULT '0',
  `date_updated` int(10) DEFAULT '0',
  `group_active` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: ___inbox_messages
#

DROP TABLE IF EXISTS `___inbox_messages`;

CREATE TABLE `___inbox_messages` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `subject` varchar(255) DEFAULT NULL,
  `message` text,
  `from` int(9) NOT NULL,
  `to` int(9) NOT NULL,
  `date_sent` int(10) NOT NULL,
  `date_read` int(10) unsigned NOT NULL DEFAULT '0',
  `deleted` int(1) NOT NULL DEFAULT '0',
  `from_username` varchar(100) NOT NULL,
  `to_username` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: ___login_attempts
#

DROP TABLE IF EXISTS `___login_attempts`;

CREATE TABLE `___login_attempts` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `ip_address` varchar(45) NOT NULL,
  `login` varchar(100) NOT NULL,
  `time` int(11) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: ___pbeat
#

DROP TABLE IF EXISTS `___pbeat`;

CREATE TABLE `___pbeat` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned DEFAULT NULL,
  `course_code` varchar(32) DEFAULT NULL,
  `lid` varchar(10) DEFAULT NULL,
  `spent_time` int(11) unsigned NOT NULL DEFAULT '0',
  `watch_time` float(12,6) NOT NULL DEFAULT '0.000000',
  `current_time` float(12,6) DEFAULT NULL,
  `finished` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `time` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: ___question_likes
#

DROP TABLE IF EXISTS `___question_likes`;

CREATE TABLE `___question_likes` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned DEFAULT NULL,
  `qid` int(11) unsigned DEFAULT NULL,
  `time` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=90 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: ___sent_messages
#

DROP TABLE IF EXISTS `___sent_messages`;

CREATE TABLE `___sent_messages` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `subject` varchar(255) DEFAULT NULL,
  `message` text,
  `from` int(9) NOT NULL,
  `to` int(9) NOT NULL,
  `date_sent` int(10) NOT NULL,
  `date_read` int(10) unsigned NOT NULL DEFAULT '0',
  `from_username` varchar(100) NOT NULL,
  `to_username` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: ___system_logs
#

DROP TABLE IF EXISTS `___system_logs`;

CREATE TABLE `___system_logs` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `time_unix` int(10) unsigned DEFAULT NULL,
  `type` varchar(10) DEFAULT NULL,
  `log` varchar(255) DEFAULT NULL,
  `severity` tinyint(1) unsigned DEFAULT NULL,
  `IP` varchar(15) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=211 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: ___user_courses
#

DROP TABLE IF EXISTS `___user_courses`;

CREATE TABLE `___user_courses` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned DEFAULT NULL,
  `course_code` varchar(32) DEFAULT NULL,
  `date_start` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: ___users
#

DROP TABLE IF EXISTS `___users`;

CREATE TABLE `___users` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `ip_address` varchar(15) NOT NULL,
  `username` varchar(100) NOT NULL,
  `password` varchar(255) NOT NULL,
  `salt` varchar(255) DEFAULT NULL,
  `email` varchar(100) NOT NULL,
  `activation_code` varchar(40) DEFAULT NULL,
  `forgotten_password_code` varchar(40) DEFAULT NULL,
  `forgotten_password_time` int(11) unsigned DEFAULT NULL,
  `remember_code` varchar(40) DEFAULT NULL,
  `created_on` int(11) unsigned NOT NULL,
  `user_updated` int(10) DEFAULT '0',
  `last_login` int(11) unsigned DEFAULT NULL,
  `active` tinyint(1) DEFAULT NULL,
  `first_name` varchar(50) DEFAULT NULL,
  `last_name` varchar(50) DEFAULT NULL,
  `company` varchar(100) DEFAULT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `email_valid` tinyint(1) NOT NULL DEFAULT '0',
  `force_pass_update` tinyint(1) NOT NULL DEFAULT '0',
  `note` text,
  `website` varchar(255) DEFAULT NULL,
  `table_add_advanced` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `language` varchar(10) DEFAULT NULL,
  `profile_img` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=92 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: ___users_groups
#

DROP TABLE IF EXISTS `___users_groups`;

CREATE TABLE `___users_groups` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned DEFAULT NULL,
  `group_id` int(11) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8;



